import { useQuery } from "react-query";
import { fetchCoinInfoData } from "../api";
import styled from "styled-components";

const DivContainer = styled.div`
  background-color: white;
  align-items: center;
  border-radius: 15px;
  height: 23px;
`;

const SpanContainer = styled.p`
  color: black;
  text-align: center;
  font-size: 20px;
`;
interface ITag {
  id: string;
  name: string;
  coin_counter: number;
  ico_counter: number;
}
interface IPrice {
  id: string;
  name: string;
  symbol: string;
  rank: number;
  is_new: boolean;
  is_active: boolean;
  type: string;
  tags: ITag[];
  description: string;
  message: string;
  open_source: boolean;
  started_at: string;
  development_status: string;
  hardware_wallet: boolean;
  proof_type: string;
  org_structure: string;
  hash_algorithm: string;
  first_data_at: string;
  last_data_at: string;
}
interface PriceProps {
  coinId: string;
}
function Price({ coinId }: PriceProps) {
  const { isLoading, data } = useQuery<IPrice>(["priceQuery"], () =>
    fetchCoinInfoData(coinId)
  );
  return (
    <div>
      {isLoading ? (
        "Loading Price....."
      ) : (
        <DivContainer>
          <SpanContainer>NAME :{data?.name}</SpanContainer>
        </DivContainer>
      )}
    </div>
  );
}

export default Price;
